  width: 100%;
  height: 154px;
  border-radius: 10px;
  border: solid 1px #dbdbdb;
  margin-top: 9px;
  padding: 18px 23px;
  box-sizing: border-box;
`;
function TextArea() {
  const dispatch = useDispatch();

  return (
    <Wrapper
      onBlur={(e) => {
        console.log(e.target.value);
      }}
    ></Wrapper>
  );
}

export default TextArea;
